import React from "react";
import './Movies.css';


function Bookingpage() {
    const [date, setDate] = useState(new Date());
  
    useEffect(() => {
      const timer = setInterval(() => {
        setDate(new Date());
      }, 1000);
  
      return () => {
        clearInterval(timer);
      };
    }, []);
  
    return (
      <div>
        <h1>Current Date and Time: {date.toLocaleString()}</h1>
      </div>
    );
  }
